import React from "react";
import styles from "./List.module.css";
import Datetime from "../Date/Datetime";
import{ FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import{ faCloud, faCloudMoonRain, faCloudRain, faMoon, faSun, faWind } from "@fortawesome/free-solid-svg-icons";
const List= ({city, temp, winds,clima, data,hora,forecast})=> {
var showdate= new Date();
var s=showdate.getHours();
var condicion;
var dat="";
var url= "`https://openweathermap.org/img/w`";
    if(city){
const $clima= clima[0].description;

        if($clima==="few clouds"){
         condicion=<FontAwesomeIcon className={styles.icono} icon={faCloud}/>
        }else if($clima===("broken clouds" || "scattered clouds") && s<19){
         condicion=<FontAwesomeIcon className={styles.icono} icon={faCloudRain}/>
        }else if($clima===("broken clouds" || "scattered clouds") && s>19) {
         condicion=<FontAwesomeIcon className={styles.icono} icon={faCloudMoonRain}/>
        }
         if($clima==="clear sky" && ( s>4&& s<=19) ){
            condicion=<FontAwesomeIcon className={styles.icono} icon={faSun}/>
           }else if($clima==="clear sky" && ( s<4 ||s>=19)){
            condicion=<FontAwesomeIcon className={styles.icono} icon={faMoon}/>
           }

    }
    dat= url + clima[0].icon + ".png";
    console.log(dat)
    return (
    <div className={styles.container}>
        <div className={styles.dateTime}>
            <Datetime />
        </div>

        <div className={styles.header}>
            <div className={styles.firstSun}>
                <div className={styles.cityName}>
                    <h1>{city.name}</h1>
                </div>
                <div className={styles.cityHour}>
                    <h5>
                    Mon Jun 13 2022 13:27:03 GMT+0100 (hora de verano británica)
                    </h5>
                </div>
            </div>
           <p>aqui
            <img src={dat} alt="" />

           </p>
           <div className={styles.secondSun}>
                <div className={styles.icon}>
                 <h1> {condicion}</h1>
                </div>
                <div className={styles.temperature}>
                    <h1>{temp.temp}º</h1>  
                </div>
                <div className={styles.adds}> 
                    <h5>Feels like: {temp.feels_like}º</h5>
                    <h6>Min: {temp.temp_min}º</h6>
                    <h6>Max: {temp.temp_max}º</h6>
                    <h6>Humidity: {temp.humidity}% </h6>
                    <div className={styles.windSpeed}>
                     <FontAwesomeIcon className={styles.icono} icon={faWind}/> 
                       <h5>Wind: { winds.speed} m/s </h5>
                    </div>
                </div>
           </div>
        </div>     
    </div>
    );}
  export default List;
